import { useState } from "react";

interface Props {
  children: string;
  onClick?: () => void;
}

function handleButtonClick(){
  setShowList(!showList);
}

const Pills = ({ children }: Props) => {
  const [showList, setShowList] = useState(false);

  return (
    <>
    <button className="btn pill"> {children}</button>
    <ul>
      <li>Minimizzazione</li>
      <li>Occultamento</li>
      <li>Aggregazione</li>
      <li>Separazione</li>
      <li>Dimostrazione</li>
      <li>Indormazione</li>
      <li>Rafforzamento</li>
      <li>Controllo</li>
    </ul>
    </>
  )
};

export default Pills;
